<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8">
<title>Digits OCR</title>
<script type="text/javascript" src="https://cdn.jsdelivr.net/npm/libsvm-js@0.2.1/dist/browser/wasm/libsvm.js"></script> 
<style>
.container {
  margin: 0px auto;
  width: 640px;
  height: 480px;
  border: 10px #333 solid;
}
#videoElement {
  width: 640px;
  height: 480px;
  background-color: #666;
}
#pixelsContainer {
  position: relative;
  left: 80px;
  width: 480px;
  height: 480px;
  background-color: #ccc;
}
.pixelElement {
  float: left;
  width: 60px;
  height: 60px;
}
#predictionContainer {
  text-align: center;
  width: 640px;
  height: 480px;
  font-size: 28em;
}
</style>
</head>
 
<body>
<h2>Original Video</h2>
<div class="container">
  <video autoplay="true" id="videoElement"></video>
</div>
<hr />

<h2>Canvas</h2>
<div class="container">
  <canvas id="canvasElement"></canvas>
</div>
<hr />

<h2>Down Sampled Pixels</h2>
<div class="container">
  <div id="pixelsContainer"></div>
</div>
<hr />

<h2>Predicted Digit</h2>
<div class="container">
  <div id="predictionContainer">?</div>
</div>

<script>
const IMAGE_PIXELS = 8;
const video = document.querySelector('#videoElement');
const canvas = document.querySelector('#canvasElement');
const context = canvas.getContext('2d');
const pixels = document.querySelector('#pixelsContainer');
const prediction = document.querySelector('#predictionContainer');

function require(url){
  if (url.toLowerCase().substr(-3) !== '.js') url += '.js'; // to allow loading without js suffix;
  if (!require.cache) require.cache = []; //init cache
  var exports = require.cache[url]; //get from cache
  if (!exports) { //not cached
    try {
      exports = {};
      var X = new XMLHttpRequest();
      X.open("GET", url, 0); // sync
      X.send();
      if (X.status && X.status !== 200) throw new Error(X.statusText);
      var source = X.responseText;
      // fix (if saved form for Chrome Dev Tools)
      if (source.substr(0, 10) === "(function(") {
        var moduleStart = source.indexOf('{');
        var moduleEnd = source.lastIndexOf('})');
        var CDTcomment = source.indexOf('//@ ');
        if (CDTcomment > -1 && CDTcomment < moduleStart + 6) moduleStart = source.indexOf('\n', CDTcomment);
        source = source.slice(moduleStart + 1, moduleEnd - 1);
      }
      // fix, add comment to show source on Chrome Dev Tools
      source = "//@ sourceURL=" + window.location.origin + url + "\n" + source;
      //------
      var module = {id: url, uri: url, exports: exports}; //according to node.js modules
      var anonFn = new Function("require", "exports", "module", source); //create a Fn with module code, and 3 params: require, exports & module
      anonFn(require, exports, module); // call the Fn, Execute the module
      require.cache[url] = exports = module.exports; //cache obj exported by module
    } catch (err) {
      throw new Error("Error loading module " + url + ": " + err);
    }
  }
  return exports; //require returns object exported by module
}

function pixelIntensity(x, y, rawPixelData, rawPixelPerPixel, rawPixelWidth, rawPixelMargin) {
  const rawPixelStart = (rawPixelMargin + (y * rawPixelPerPixel * rawPixelWidth) + (x * rawPixelPerPixel)) * 4;
  const rawPixelEnd = rawPixelStart + (rawPixelPerPixel * rawPixelWidth * 4);
  var intensity = 0;
 
  for (let rowStartIdx = rawPixelStart; rowStartIdx < rawPixelEnd; rowStartIdx += rawPixelWidth * 4) {
    for (let colStartIdx = rowStartIdx; colStartIdx < rowStartIdx + rawPixelPerPixel * 4; colStartIdx += 4) {
      intensity += rawPixelData[colStartIdx] + rawPixelData[colStartIdx + 1] + rawPixelData[colStartIdx + 2];
    }
  }
 
  //return Math.floor(intensity / (rawPixelPerPixel * rawPixelPerPixel * 3 * 16));
  const num = Math.floor(intensity / (rawPixelPerPixel * rawPixelPerPixel * 3 * 16));
  //return num;
  // Increase contrast
  if (num < 2) return 0;
  else if (num < 4) return 1;
  else if (num < 6) return 2;
  else if (num < 8) return 3;
  else if (num < 10) return 12;
  else if (num < 12) return 13;
  else if (num < 14) return 14;
  else return 15;
}

function processFrame(video, svm) {
  context.drawImage(video, 0, 0);
  let rawPixelData = context.getImageData(0, 0, canvas.width, canvas.height).data;
  let pixelData = [];
  while (pixels.firstChild) {
    pixels.removeChild(pixels.firstChild);
  }
  for (let y = 0; y < IMAGE_PIXELS; y++) {
    for (let x = 0; x < IMAGE_PIXELS; x++) {
      let intensity = pixelIntensity(x, y, rawPixelData, video.videoHeight / IMAGE_PIXELS, video.videoWidth, (video.videoWidth - video.videoWidth) / 2);
      let intensityHex = intensity.toString(16);
      let pixel = document.createElement('div');
      pixel.setAttribute('class', 'pixelElement');
      pixel.setAttribute('style', 'background-color: #' + intensityHex + intensityHex + intensityHex + ';');
      pixels.appendChild(pixel);
      pixelData.push(15 - intensity); // inverse color to match feature data
    }
  }
  const predictedLabel = svm.predictOne(pixelData);
  while (prediction.firstChild) {
    prediction.removeChild(prediction.firstChild);
  }
  prediction.appendChild(document.createTextNode(predictedLabel));

  setTimeout(function () {
    processFrame(video, svm);
  }, 50);
}

if (navigator.mediaDevices.getUserMedia) {
  navigator.mediaDevices.getUserMedia({ video: true }).
    then(function (stream) {
      video.srcObject = stream;
    }).
    catch(function (err) {
      console.log('Something went wrong!');
    });
}
